/**
 * The following are a subset of types from vite/client.d.ts
 * Removed the types related to static assets since we handle assets differently
 */
declare module "*.wasm?init" {
    const initWasm: (options?: WebAssembly.Imports) => Promise<WebAssembly.Instance>;
    export default initWasm;
}
declare module "*?worker" {
    const workerConstructor: new (options?: {
        name?: string;
    }) => Worker;
    export default workerConstructor;
}
declare module "*?worker&inline" {
    const workerConstructor: new (options?: {
        name?: string;
    }) => Worker;
    export default workerConstructor;
}
declare module "*?worker&url" {
    const src: string;
    export default src;
}
declare module "*?sharedworker" {
    const sharedWorkerConstructor: new (options?: {
        name?: string;
    }) => SharedWorker;
    export default sharedWorkerConstructor;
}
declare module "*?sharedworker&inline" {
    const sharedWorkerConstructor: new (options?: {
        name?: string;
    }) => SharedWorker;
    export default sharedWorkerConstructor;
}
declare module "*?sharedworker&url" {
    const src: string;
    export default src;
}
declare module "*?raw" {
    const src: string;
    export default src;
}
declare module "*?inline" {
    const src: string;
    export default src;
}
